import React from "react";
import { Row, Col, Container, Card } from "react-bootstrap";
const Dashboard = () => {
  return (
    <>
      <Container>
        <Row>
          <Col md={8}></Col>
          <Col md={4}> </Col>
        </Row>
      </Container>
    </>
  );
};

export default Dashboard;
